import React, { useState } from 'react';
import cl from "./auctionPage.module.css"
import axios from 'axios';

interface generalItemInfo {
    id: string,
    name: string,
    description: string
}

interface concretInfoName {
    id: string,
    item: generalItemInfo,
    quantity: number,
    price: number,
    image: string
}

interface allPage {
    results: concretInfoName[],
    count: number,
    current_page: number,
    total_pages: number
}





const AuctionPage = () => {
    const [itemsListm, setItemsListm] = useState<concretInfoName[]>([
        {
          id: "1",
          item: {
            id: "101",
            name: "Антикварная ваза",
            description: "Китайская ваза XVIII века, отличное состояние"
          },
          quantity: 1,
          price: 25000,
          image: "/images/antique_vase.jpg"
        },
        {
          id: "2",
          item: {
            id: "102",
            name: "Золотые часы",
            description: "Швейцарские часы 1950 года, золотой корпус"
          },
          quantity: 1,
          price: 18000,
          image: "/images/gold_watch.jpg"
        },
        {
          id: "3",
          item: {
            id: "103",
            name: "Картина 'Закат'",
            description: "Масло, холст, современный художник"
          },
          quantity: 1,
          price: 7500,
          image: "/images/sunset_painting.jpg"
        },
        {
          id: "4",
          item: {
            id: "104",
            name: "Редкая монета",
            description: "Золотая монета 1897 года, Российская Империя"
          },
          quantity: 1,
          price: 32000,
          image: "/images/rare_coin.jpg"
        },
        {
          id: "5",
          item: {
            id: "105",
            name: "Винтажное колье",
            description: "Ар-деко, 1920-е годы, с бриллиантами"
          },
          quantity: 1,
          price: 42000,
          image: "/images/vintage_necklace.jpg"
        }
      ])



    const fetchData = async () => {
        try {
            const response = await axios.get<allPage>("/api/v1/game/auction/1/");
            setItemsListm(response.data.results)
        } catch {
            alert("Произошла ошибка при загрузке аукциона")
        }
    }




  return (
    <div
    style={{}}
    className={cl.auctionContainer}>
        <h1 className={cl.auctionContainer__title}>АУКЦИОН</h1>
        <div className={cl.auctionContainer__items}>
        {itemsListm.map((item) => 
        <div
        className={cl.auctionContainer__item}
         >
            <span className={cl.auctionContainer__item__name}>{item.item.name}</span>
            <span className={cl.auctionContainer__item__description}>{item.item.description}</span>
         </div>
        )} 
        </div>
    </div>
  );
};

export default AuctionPage;
